-- ----------------------------
-- Table structure for work_project
-- ----------------------------
DROP TABLE IF EXISTS `work_project`;
CREATE TABLE `work_project` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `proj_no` varchar(64) NOT NULL DEFAULT '' COMMENT '项目编号',
  `proj_name` varchar(128) DEFAULT NULL COMMENT '项目名称',
  `proj_type` int(2) DEFAULT '1' COMMENT '项目类型',
  `proj_desc` varchar(500) DEFAULT NULL COMMENT '项目描述',
  `start_date` datetime DEFAULT NULL COMMENT '开始日期',
  `end_date` datetime DEFAULT NULL COMMENT '结束日期',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `product_no` varchar(64) DEFAULT NULL COMMENT '关联产品',
  `plan_no` varchar(64) DEFAULT NULL COMMENT '关联计划',
  `authority` int(2) NOT NULL DEFAULT '1' COMMENT '权限',
  `reckon_hour` decimal(5,1) DEFAULT '0.0' COMMENT '预计工时',
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_work_project_no` (`proj_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='项目';

