DROP TRIGGER IF EXISTS `tr_insert_waybill_detail`;
DELIMITER ;;
CREATE TRIGGER `tr_insert_waybill_detail` AFTER INSERT ON `ex_waybill` FOR EACH ROW begin
    
    insert into ex_waybill_detail(waybill_id) values(new.waybill_id);
end
;;
DELIMITER ;
